import React from 'react'

const Track = (props) =>{
    const { track }=props;

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
            <div calssName ="card-body">
                <h5>{track.album}</h5>
            </div>
            </div>

        </div>
    )
}
export default Track;
